// Import the tsparticles library without destructuring
import Particles from "react-tsparticles";
import tsparticles from "tsparticles";

const ParticleBg = () => {
    const particlesInit = async (main) => {
        console.log(main);
    
        // use the correct import for loadFull
        await tsparticles.loadFull(main);
    };

    return (
        <Particles
            id="tsparticles"
            init={particlesInit}
            options={{
                // ... your particle options
            }}
        />
    );
};

export default ParticleBg;
